<script>
  import { mdbBtn, mdbModal,mdbBtnGroup, mdbBtnToolbar, mdbModalHeader, mdbModalTitle, mdbModalBody, mdbModalFooter, mdbTooltip, Popover, mdbInput, mdbTextarea, mdbContainer, mdbRow, mdbCol, mdbIcon, mdbTbl, mdbTblHead, mdbTblBody,mdbCard, mdbCardBody,mdbJumbotron,mdbSelect,FormInline,mdbDropdown, mdbDropdownItem, mdbDropdownMenu, mdbDropdownToggle, mdbCardTitle, mdbCardText,  mdbCardHeader} from 'mdbvue';

  import axios from 'axios';
    const obj = {};

    export default {
      components:{
        mdbBtn, mdbModal,mdbBtnGroup, mdbBtnToolbar, mdbModalHeader, mdbModalTitle, mdbModalBody, mdbModalFooter, mdbTooltip, Popover, mdbInput, mdbTextarea, mdbContainer, mdbRow, mdbCol, mdbIcon, mdbTbl, mdbTblHead, mdbTblBody,mdbCard, mdbCardBody,mdbJumbotron,mdbSelect,FormInline,mdbDropdown, mdbDropdownItem, mdbDropdownMenu, mdbDropdownToggle, mdbCardTitle, mdbCardText,  mdbCardHeader
      },
        props: {
            files: {
                type: Array,
                default: () => []
            },
            uploadFiles: [],
        },
        data() {
            return {
                dragAndDropCapable: false,
                uploadPercentage: 0,
                channel_name: '',
                channel_fields: [],
                channel_entries: [],
                parse_header: [],
                parse_csv: [],
                sortOrders:{},
                sortKey: '',
                matrix: {name: null, json: null},
                matrixCollection: {},
                image: ''
            };
        },

        mounted(){
            /*
              Determine if drag and drop functionality is capable in the browser
            */
            this.dragAndDropCapable = this.determineDragAndDropCapable();

            /*
              If drag and drop capable, then we continue to bind events to our elements.
            */
            if( this.dragAndDropCapable ){
                /*
                  Listen to all of the drag events and bind an event listener to each
                  for the fileform.
                */
                ['drag', 'dragstart', 'dragend', 'dragover', 'dragenter', 'dragleave', 'drop'].forEach( function( evt ) {
                    /*
                      For each event add an event listener that prevents the default action
                      (opening the file in the browser) and stop the propagation of the event (so
                      no other elements open the file in the browser)
                    */
                    this.$refs.fileform.addEventListener(evt, function(e){
                        e.preventDefault();
                        e.stopPropagation();
                    }.bind(this), false);
                }.bind(this));

                /*
                  Add an event listener for drop to the form
                */
                this.$refs.fileform.addEventListener('drop', function(e) {
                    /*
                      Capture the files from the drop event and add them to our local files
                      array.
                    */
                    for( let i = 0; i < e.dataTransfer.files.length; i++ ){
                        this.files.push( e.dataTransfer.files[i] );
                        //console.log("name::"+e.dataTransfer.files[i].name);
                        this.loadCSV(e.dataTransfer.files[i]);
                        this.createImage(e.dataTransfer.files[i]);
                        this.getImagePreviews();
                    }

                }.bind(this));
            }
        },

        filters: {
            capitalize: function (str) {
                return str.charAt(0).toUpperCase() + str.slice(1)
            }
        },

        methods: {
            createImage(file) {
                let reader = new FileReader();
                let vm = this;
                reader.onload = (e) => {
                    vm.image = e.target.result;
                };
                reader.readAsDataURL(file);
            },
            determineDragAndDropCapable(){
                /*
                  Create a test element to see if certain events
                  are present that let us do drag and drop.
                */
                var div = document.createElement('div');

                /*
                  Check to see if the `draggable` event is in the element
                  or the `ondragstart` and `ondrop` events are in the element. If
                  they are, then we have what we need for dragging and dropping files.

                  We also check to see if the window has `FormData` and `FileReader` objects
                  present so we can do our AJAX uploading
                */
                return ( ( 'draggable' in div )
                    || ( 'ondragstart' in div && 'ondrop' in div ) )
                    && 'FormData' in window
                    && 'FileReader' in window;
            },
            /*
           Gets the image preview for the file.
         */
            getImagePreviews(){
                /*
                  Iterate over all of the files and generate an image preview for each one.
                */
                for( let i = 0; i < this.files.length; i++ ){
                    /*
                      Ensure the file is an image file
                    */
                    //console.log('dsdsds ffff'+JSON.stringify( this.files[i].name));
                    if ( /\.(jpe?g|png|gif)$/i.test( this.files[i].name ) ) {
                        /*
                          Create a new FileReader object
                        */
                        let reader = new FileReader();

                        /*
                          Add an event listener for when the file has been loaded
                          to update the src on the file preview.
                        */
                        reader.addEventListener("load", function(){
                            this.$refs['preview'+parseInt( i )][0].src = reader.result;
                        }.bind(this), false);

                        /*
                          Read the data for the file in through the reader. When it has
                          been loaded, we listen to the event propagated and set the image
                          src to what was loaded from the reader.
                        */

                        reader.readAsDataURL( this.files[i] );
                    }else{
                        /*
                          We do the next tick so the reference is bound and we can access it.
                        */
                        this.$nextTick(function(){
                            //this.$refs['preview'+parseInt( i )][0].src = '/images/file.png';
                        });
                    }
                }
            },
            /*
              Removes a select file the user has uploaded
            */
            removeFile( key ){
                this.files.splice( key, 1 );
            },
            sortBy: function (key) {
                var vm = this
                vm.sortKey = key
                vm.sortOrders[key] = vm.sortOrders[key] * -1
            },
            fixBinary (bin) {
                var length = bin.length;
                var buf = new ArrayBuffer(length);
                var arr = new Uint8Array(buf);
                for (var i = 0; i < length; i++) {
                    arr[i] = bin.charCodeAt(i);
                }
                return buf;
            },
            csvJSON(csv, fileName){
                var vm = this
                var lines = csv.split("\n")
                var result = []
                var headers = lines[0].split(";")
                vm.parse_header = lines[0].split(";")
                lines[0].split(";").forEach(function (key) {
                    vm.sortOrders[key] = 1
                });

                //console.log("KOKO lines:"+JSON.stringify(lines));
                //console.log("fiel name:"+fileName);
                var axisX = [];
                var matrixCollection = {};
                var matrixIndex = 0;
                var fileNameWithoutExtention = fileName.replace(".csv", "");
                lines.map(function(line, indexLine){
                    if (indexLine == 0) {
                        axisX = line.replace("\r", "").split(";");
                    } else {
                        var currentline = line.replace("\r", "").split(";");
                        for (var i=1; i < currentline.length; i++) {
                            //console.log("y:"+i+":y"+currentline[0]+"x:"+ axisX[i] +"value:"+currentline[i]);
                            matrixCollection[matrixIndex++] = {"x": axisX[i], "y":currentline[0], "value": currentline[i]};
                        }
                    }
                });
                this.matrixCollection[fileNameWithoutExtention] = matrixCollection;
                this.$emit('update-matrix', this.matrixCollection);
               // console.log("zz:"+JSON.stringify(this.matrixCollection));
                lines.map(function(line, indexLine){
                    if (indexLine < 1) return // Jump header line

                    var obj = {}
                    var currentline = line.split(";");

                    headers.map(function(header, indexHeader){
                        obj[header] = currentline[indexHeader]
                    });
                    //console.log('EEE:'+JSON.stringify(obj));
                    result.push(obj);
                    //console.log('result:'+JSON.stringify(result));
                });

                result.pop(); // remove the last item because undefined values

                return result // JavaScript object
            },
            loadCSV(file) {
                var vm = this
/*
 Image --- It works
                let formData = new FormData();
                var base64Image = "data:image/jpg;base64,";
                var contentType = 'image/png';

                //var blob = this.b64toBlob(base64Image, contentType);
                var binary = this.fixBinary(atob(base64Image.replace(/^data:image\/(png|jpeg|jpg);base64,/, '')));
                //var byteCharacters = atob(imageData.replace(/^data:image\/(png|jpeg|jpg);base64,/, ''));
                var blob = new Blob([binary], {type: 'image/jpg'});
                console.log('blob:'+JSON.stringify(blob));
                formData.append('imageBlob', base64Image.replace(/^data:image\/(png|jpeg|jpg);base64,/, ''));
                formData.append('name', 'KOKOKO');

                axios.post('http://127.0.0.1:8000/api/image',
                    formData,
                    {
                        headers: {
                            'Content-Type': 'multipart/form-data'
                        }
                    }
                ).then(function(){
                    console.log('SUCCESS!!');
                })
                .catch(function(){
                    console.log('FAILURE!!');
                });*/

                if (window.FileReader) {
                    var reader = new FileReader();
                    reader.readAsText(file);
                    // Handle errors load
                    reader.onload = function(event) {

                        var csv = event.target.result;
                        vm.parse_csv = vm.csvJSON(csv, file.name)
                        //console.log('WQWQ:'+JSON.stringify(csv));
                        //console.log('RERE:'+JSON.stringify(vm.parse_csv));
                    };
                    //console.log('HOHO:'+JSON.stringify(vm.parse_csv));
                    reader.onerror = function(evt) {
                        if(evt.target.error.name == "NotReadableError") {
                            alert("Canno't read file !");
                        }
                    };
                } else {
                    alert('FileReader are not supported in this browser.');
                }
            }
        }
    }
</script>
